import React, { useState } from 'react';
import axios from 'axios';
import './LoginPage.css';

function LoginPage() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleLogin = (e) => {
    e.preventDefault();
    axios.post('https://tenniscourt-backend.onrender.com/login', { username, password })
      .then(response => {
        localStorage.setItem('access_token', response.data.access_token);
        // Redirect or handle login success
        alert('Login successful!');
        // Example: Redirect to admin page or homepage
        window.location.href = '/admin'; 
      })
      .catch(error => {
        setError('Invalid username or password');
      });
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Tennis Playground Reservations</h1>
      </header>
      <main>
        <section className="reservation-form">
          <h2>Reserve Your Spot</h2>
          <form onSubmit={handleSubmit}>
            <input
              type="text"
              placeholder="First Name"
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Last Name"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
              required
            />
            <input
              type="tel"
              placeholder="Phone Number"
              value={phone}
              onChange={(e) => setPhone(e.target.value)}
              required
            />
            <button
              type="button"
              onClick={sendVerification}
              disabled={verificationSent}
            >
              Send Verification Code
            </button>
            {verificationSent && (
              <>
                <input
                  type="text"
                  placeholder="Enter OTP"
                  value={otp}
                  onChange={(e) => setOtp(e.target.value)}
                  required
                />
                <button type="button" onClick={verifyCode}>
                  Verify Code
                </button>
              </>
            )}
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="date"
              value={date}
              onChange={(e) => setDate(e.target.value)}
              required
              min={weekDates[0]}
              max={weekDates[6]}
            />
            <select
              value={startTime}
              onChange={(e) => {
                setStartTime(e.target.value);
                setEndTime(''); // Reset end time when start time changes
              }}
              required
            >
              <option value="" disabled>Select Start Time</option>
              {availableTimes.map(slot => (
                <option key={slot} value={slot}>
                  {slot}
                </option>
              ))}
            </select>
            <select
              value={endTime}
              onChange={(e) => setEndTime(e.target.value)}
              required
              disabled={!startTime} // Disable end time selection until start time is chosen
            >
              <option value="" disabled>Select End Time</option>
              {startTime && filterEndTimes(startTime).map(slot => (
                <option key={slot} value={slot}>
                  {slot}
                </option>
              ))}
            </select>
            <button type="submit">Make a Reservation</button>
          </form>

          <div className="contact-info">
            <p>For payments and support, call: <strong>058-560-5002</strong></p>
          </div>
        </section>
        
        <section className="map-container-wrapper">
          <MapContainer center={position} zoom={13} className="map-container">
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            <Marker position={position}>
              <Popup>
                Tennis Court Location
              </Popup>
            </Marker>
          </MapContainer>
        </section>
      </main>
      <footer className="App-footer">
        <p>&copy; 2024 Tennis Playground. All rights reserved.</p>
      </footer>
    </div>
  );
}


export default LoginPage;
